const templateRepository = new Map();
templateRepository.set("appointment_list", "");
templateRepository.set("appointments-search_main", "");
templateRepository.set("authentication-pane", "");
templateRepository.set("calendar-grid_main", "");
templateRepository.set("calendar-grid_rows", "");
templateRepository.set("calendar-mutation-form", "");
templateRepository.set("calendar-mutation-form_conflicts", "");
templateRepository.set("day-appointments_main", "");
templateRepository.set("unread-appointments_main", "");

        function getTemplate(templateId) {
            const templateContent = templateRepository.get(templateId);
            if(!templateContent) throw "Unknown template for id " + templateId;
            const text = decodeURI(atob(templateContent));
            return text;
        }
        window['getAppTemplate'] = getTemplate;
        